INSERT INTO `fboard` (`fno`, `moddate`, `regdate`, `fcontent`, `ftitle`, `fwriter`) VALUES
	(1, '2023-03-03 17:37:13.584561', '2023-03-03 17:37:13.584561', '테스트입니다.\r\nThis is Test\r\nテストです。\r\nC\'est un test.\r\nЭто тест.\r\nเป็นการทดสอบครับ\r\nĐây là bài test.\r\nTest, Ecco.\r\n是测试。', '테스트.', '관리자'),
	(2, '2023-03-06 09:38:28.357550', '2023-03-06 09:38:28.357550', '네, 자바카페 리워드 회원이라면 자바카페 어플로 주문 시 모든 쿠폰이 온라인 쿠폰으로 발행되며, \r\n매장에서 등록된 자바카페 카드로 결제 시에는 영수증 쿠폰, 온라인 쿠폰 중 선택하실 수 있습니다.', ' 영수증 쿠폰을 온라인 쿠폰으로 바로 받을 수 있나요?', '관리자'),
	(3, '2023-03-06 09:39:01.358653', '2023-03-06 09:39:01.358653', '설문 조사 완료 후, 24시간 내 고객님의 계정으로 보너스 스탬프 1개가 지급됩니다.', '고객경험 설문조사를 완료하면 어떤 혜택이 있나요?', '관리자'),
	(4, '2023-03-06 09:40:55.623161', '2023-03-06 09:40:55.623161', '방문에 감사 드리는 의미로, 자바카페 리워드 회원이 본인 계정에 등록된 자바카페 카드로 1,000원 이상 결제 시 영수증당 스탬프 1개가 즉시 적립됩니다. (단, 영수증간 금액 합산 적용은 불가하며, 자바카페 카드 충전 금액은 별 적립 대상이 아닙니다. \r\nExtra 또는 Size Upgrade 금액만 결제하는 경우, 방문별 적립 기준 금액 충족 시 별 적립 가능합니다.\r\n교환증으로 상품 교환 시 자바카페 리워드 혜택 제공이 불가합니다.)\r\n\r\n온라인 오더를 통해 주문하신 경우, 별 적립 시점은 아래와 같습니다.\r\n- 음료/푸드/원두 주문의 경우, 매장에서 해당 주문을 승인한 시점\r\n- 홀케이크 선물/예약의 경우 홀케이크 수령 시점\r\n\r\n자바카페 카드로 결제 후 고객님께 최상의 서비스를 제공하는 시간은 약 3분이 소요됩니다. \r\n따라서 이 시간 동안 추가 결제 시 방문당 스탬프 적립되지 않고, 이벤트가 있을 경우 이벤트 스탬프만 적립됩니다.', '스탬프 적립 기준은 무엇인가요?', '관리자'),
	(5, '2023-03-06 09:43:17.011328', '2023-03-06 09:43:17.011328', '안녕하세요. 자바카페입니다.\r\n\r\n보다 나은 서비스를 제공하고자 아래와 같이 시스템 서버 작업을 진행합니다.\r\n\r\n \r\n\r\n- 일자 및 시간: 2023년 1월 25일(수) 23시 30분 ~ 1월 26일(목) 05시 30분(6시간)\r\n\r\n- 대상 서비스 : 자바카페 홈페이지 / 자바카페 APP / Bixby / 삼성카드 자바카페 오더 / 신한PayFAN 자바카페 오더 / 네이버 주문 / 자바카페 현대카드 발급 서비스\r\n\r\n- 점검 내용: 시스템 서버 작업\r\n\r\n \r\n\r\n해당 점검 시간 중 웹/앱 및 외부 채널 서비스 이용이 제한되오니 양해 부탁드리겠습니다.\r\n\r\n감사합니다.', '시스템 개선 및 서비스 점검 안내 ', '관리자'),
	(6, '2023-03-06 09:45:22.701579', '2023-03-06 09:45:22.701579', '매장 내 근무하는 전 직원들은\r\n단정한 복장을 유지해주시기 바랍니다.\r\n\r\n또 한 지각 혹은 무단결근을 할 시 불이익이 있을 수 있는 점을 명시하시기 바랍니다.\r\n\r\n', '직원 규정', '관리자'),
	(7, '2023-03-07 10:08:26.739388', '2023-03-07 10:08:26.739388', '1\r\n창업설명회\r\n가맹지원서 및 상권조사표 작성\r\n\r\n2\r\n점포문의 및 본부확인\r\n상권 및 입지확인\r\n수도권 : 약 1주,\r\n지방 : 약 2주 소요\r\n\r\n3\r\n본사 점주 승인\r\n더본코리아 본사 검토 후\r\n가맹점 개설 여부 결정\r\n정보공개서, 가맹계약서 메일로 발송/확인\r\n\r\n4\r\n점포 개설 협의\r\n인테리어 및 시설공사 등\r\n점포 개설 과정 협의\r\n\r\n5\r\n당사 계약 체결\r\n최초 2년 계약, 이후 1년 단위 재계약\r\n임대차 계약 후 가맹 계약 체결\r\n\r\n6\r\n인테리어 & 시설공사\r\n약 3주 내외 소요, 현장 상황에 따라 변동 가능\r\n\r\n7\r\n교육\r\n점주 포함 최소 2명,\r\n교육 기간 최소 14일\r\n점주1 : 14일\r\n직원2 : 14일 (테스트 미통과 or 교육 불성실 시 재교육)\r\n\r\n8\r\n개점준비 & 가오픈\r\n운영 시뮬레이션을 통한\r\n오픈 준비사항 최종 점검\r\n\r\n9\r\n개점\r\n가맹점 정식 오픈 및 인터넷\r\n매장 정보 등록\r\n\r\n10\r\n사후 관리\r\n관리본사 점검팀 순회를 통해 주기적인 매장 점검\r\n본사 점검팀 순회를 통해 주기적인 매장 점검\r\n\r\n* 가맹 계약 후 최소 60일~90일 이후 오픈\r\n\r\n* 홈페이지 내 창업문의를 통해 본사와 상담 후 참석 및 가맹지원서 작성/제출하여야만 창업 진행 가능\r\n\r\n* 타겟 고객층에 적합한 입지를 선정/통보하여 본부의 승인을 받고 임대차/가맹 계약을 체결하여야 하며, 점주 본인이 반드시 교육을 이수해야 함', '창업안내', '관리자'),
	(8, '2023-03-09 17:44:16.999762', '2023-03-09 17:44:16.999762', 'test', 'test', '관리자'),
	(9, '2023-03-09 17:44:22.309807', '2023-03-09 17:44:22.309807', 'test3', 'test3', '관리자');
